window.bookSummaryJSON = "<p>The Epic Conclusion of the Wrangler Saga....</p> <p>Stranded in the Red Vastness with only a week to get home, Braddock vows to travel thousands of miles, bond with two sprites, and save the meadow.</p> <p>But even if he can beat the looming deadline of spring court, how can he defeat Hortensia, multiple armies hunting the Lost Treasure, and the final rise of the mighty Sidians?</p> <p>Behold the full fury of the Master of Dragons!</p> <p>Warning: This series contains adult themes, graphic violence, undefined relationships/harem, and a strong male protagonist with the rough and ready attitude of an American frontiersman. Listen at your own risk.</p>"; 
